import React, { Component } from "react";

export default class Designed extends Component {
	render() {
		return (
			<div>
				<p className="text-center">
					Designed and Developed By{" "}
					<a
						className="temacolor"
						href="https://www.instagram.com/eren.glr_bg/"
						target="_blank"
					>
						Eren
					</a>
				</p>
			</div>
		);
	}
}
